import React from 'react';

export default function Cube () {
  return (
    <div style={{ height: '200px', width: '200px'}}>
        <div className='face-front'
            style={{
                position: 'relative',
                left: '0%',
                top: '0%',
                height: '50px',
                border:'solid',
                borderWidth:'0.1.px',
                transformStyle: 'preserve-3d',
                transform: 'rotate3d(0, 0, 5, 30deg)'}}
        >
        </div>
    </div>
  );
}
